// tslint:disable-next-line: max-classes-per-file
class LinkedList {
    public head: LinkedListNode | null = null;
    public tail: LinkedListNode | null = null;
    // insert at beginning
    public insert(a: number) {
        const temp = new LinkedListNode(a);
        if (this.head == null) {
            this.head = temp;
            return;
        }
        temp.next = this.head;
        this.head = temp;
    }
    // insert at end
    public insertAtEnd(a: number) {
        const temp = new LinkedListNode(a);
        if (this.head == null ) {
            this.head = temp;
            this.tail = this.head;
            return;
        }
        if (this.tail) {
            this.tail.next = temp;
        }
        this.tail = temp;
    }
    // get count of nodes in a linked list
    public count(): number {
        let count = 0;
        if (this.head === null) {
            return count;
        }
        count = 1;
        let temp: LinkedListNode = this.head;
        while (temp.next != null) {
            ++count;
            temp = temp.next;
        }
        return count;
    }
