    public printNumbers(num: number) {
        for (let i = num; i >= 1; i--) {
            for (let k = 1; k <= (num - i) ; k++) {
                document.write("&nbsp;");
            }
            for (let j = i; j >= 1 ; j--) {
                document.write(j + "");
            }
            document.write("<br/>");
        }
    }
}

